import React from "react";
import * as ReactBootStrap from "react-bootstrap";

function PageTwoCard(props){
  return(
    <ReactBootStrap.Card style={{ width: '18rem' }} className="card">
  <ReactBootStrap.Card.Body>
    <ReactBootStrap.Card.Title>{props.title}</ReactBootStrap.Card.Title>
    <ReactBootStrap.Card.Text>
      Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et.
    </ReactBootStrap.Card.Text>
    <ReactBootStrap.Card.Link href="#">View Detils</ReactBootStrap.Card.Link>
  </ReactBootStrap.Card.Body>
</ReactBootStrap.Card>
  );
}

export default PageTwoCard;
